import React, {useState} from 'react';
import './App.css';
import Nav from './components/Nav';
import PositionMap from './components/PositionMap';
import SearchForm from './components/SearchForm';
import { Stations } from './components/Stations';
import axios from 'axios';

function App() {
  const [stationsName, setStationsName] = useState([]);


    const getSerchResult = (e) => {
      e.preventDefault();
    const result = e.target.elements.search.value;

      axios.get(`/cities-stations/${result}`)
      .then((res) => {
        setStationsName(res.data);
      });

    }
  return (

    <div>
        <Nav />
      <div className='App'>
        <PositionMap />
        <div className='data-wraper'>
          <SearchForm getSerchResult = {getSerchResult} />
          <Stations station = {stationsName} / >
          </div>

      </div>
    </div>

  );
}
export default App;
